지금은 앱 시작하자마자 시간이 바로 표시되는데 사실은 버튼을 누를 때의 시간을 기록하는 게 목적이다. 그러니 버튼을 누르기 전까지는 시간이 표시되면 안 된다. return ( <> <div className='center_div'> <div> <button>출/퇴근</button> </div> <div> </div> </div> </>
) 그래서 일단 위와 같이 시간 표시되는 부분을 없앴다. react의 상태 관리 매커니즘을 이용해 버튼 누를 때의 시간을 기록하고 보여주자. import {useState} from 'react'; function App() { const [did_time, set_did_time] = useState(""); function getdate() { const date = new Date(); return date.toLocaleDateString('ko-KR') + ' ' + date.toLocaleTimeString('ko-KR'); } function checkTime() { let current_time = getdate() set_did_time(current_time) } return ( <> <div className="center_div"> <div> <button onClick={checkTime}>출/퇴근</button> </div> <div> {did_time} </div> </div> </> )
} export default App 실행 직후. 버튼을 누르지 않으면 시간 관련 값이 세팅되어 있지 않으니 화면에 시간이 표시되지 않는다. 버튼을 누르면 onClick에 의해 checkTime 함수가 실행된다. checkTime 함수는 지금 시각을 getdate() 함수를 통해 가져오고, 이 시간 정보는 set_did_time() 함수를 통해 did_time 값을 세팅하고, 그렇게 되면 결국 react의 상태 관리 매커니즘에 따라 자동으로 그 아래쪽에 버튼을 누른 시각이 바뀐다. 처음에는 아무것도 없었으니 나타나는 것처럼 보인다. 계속 버튼을 누르면 누를 때마다 시간이 바뀌는 걸 볼 수 있다.

